import { Injectable } from '@angular/core';
import { ComplicationAgAnemie } from '../models/ComplicationAgAnemie';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class AgService {
  private apiUrl = 'https://localhost:7129/api/ComplicationAgAnemies';

  constructor(private http: HttpClient) { }
  addag(ComplicationAgAnemie: ComplicationAgAnemie): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', ComplicationAgAnemie);

    return this.http.post<any>(`${this.apiUrl}/addag`, ComplicationAgAnemie, { observe: 'response' });
  }}
